To make a file request for `srmPrepareToPut`, the following steps should be taken:

1. **Specify the Target SURL**: Provide the target SURL which is local to the SRM.
2. **Expected File Size**: Indicate the expected file size in unsigned long format.

The structure of the request is as follows:
```c
typedef struct {
    anyURI targetSURL;            // local to SRM
    unsigned long expectedFileSize;
} TPutFileRequest;
```

This structure contains the necessary information to prepare a file for upload using `srmPrepareToPut`.
